export default function GetIssues({information,page}) {
    const apiUrl = `http://localhost:3000/${information}?page=${page}`;

    return fetch(apiUrl)
      .then(res => res.json())
      .then((data)=>{
        return data.results
      })
      .catch((error) => {
        console.error(error);
      })
}
